'use client';

import { useState } from 'react';
import jsPDF from 'jspdf';
import { motion } from 'framer-motion'; // Ensure motion is imported
import { FaSearch } from 'react-icons/fa'; // Import search icon from React Icons
import { FiSearch, FiRefreshCw } from 'react-icons/fi';
import BackButton from '@/components/BackButton';
import ScrollToTopButton from '@/components/scrollup';
import { TableSkeleton, FormSkeleton } from '@/components/skeleton';

const months = [
  { value: '01', label: 'January' },
  { value: '02', label: 'February' },
  { value: '03', label: 'March' },
  { value: '04', label: 'April' },
  { value: '05', label: 'May' },
  { value: '06', label: 'June' },
  { value: '07', label: 'July' },
  { value: '08', label: 'August' },
  { value: '09', label: 'September' },
  { value: '10', label: 'October' },
  { value: '11', label: 'November' },
  { value: '12', label: 'December' },
];

export default function SearchQuotes() {
  const [filterType, setFilterType] = useState('quoteId');
  const [quoteId, setQuoteId] = useState('');
  const [year, setYear] = useState(new Date().getFullYear());
  const [fromMonth, setFromMonth] = useState('01');
  const [toMonth, setToMonth] = useState('12');
  const [customerName, setCustomerName] = useState('');
  const [quotes, setQuotes] = useState([]);
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  const handleSearch = async () => {
    setError('');
    setQuotes([]);
    setLoading(true);

    let queryParams = [];

    if (filterType === 'quoteId' && quoteId.trim()) {
      queryParams.push(`quote_id=${quoteId.trim()}`);
    } else if (filterType === 'monthRange' && fromMonth && toMonth) {
      if (fromMonth > toMonth) {
        setError('From month cannot be later than To month.');
        return;
      }

      const getLastDayOfMonth = (year, month) =>
        new Date(year, parseInt(month), 0).getDate();

      const fromDate = `${year}-${fromMonth}-01`;
      const lastDay = getLastDayOfMonth(year, toMonth);
      const toDate = `${year}-${toMonth}-${lastDay}`;

      queryParams.push(`from_date=${fromDate}`);
      queryParams.push(`to_date=${toDate}`);
    } else if (filterType === 'customerName' && customerName.trim()) {
      queryParams.push(
        `customer_name=${encodeURIComponent(customerName.trim())}`
      );
    } else {
      setError('Please select a filter and enter the required value.');
      return;
    }

    const queryString = queryParams.join('&');

    try {
      const response = await fetch(`/api/fetch?${queryString}`);
      const data = await response.json();

      if (response.ok) {
        setQuotes(data.length === 0 ? [] : data);
        if (data.length === 0) setError('No matching quotes found.');
      } else {
        setError(data.error || 'Error fetching quotes.');
      }
    } catch (err) {
      setError('Failed to fetch quotes.');
    } finally {
      setLoading(false);
    }
  };
  const generateQuote = async quote => {
    const doc = new jsPDF();

    const logoUrl =
      'data:image/jpeg;base64,';
    const qrCodeUrl =
      'data:image/jpeg;base64,';

    // Function to load images before generating the PDF
    const loadImage = url => {
      return new Promise(resolve => {
        const img = new Image();
        img.src = url;
        img.onload = () => resolve(img);
      });
    };

    try {
      const logo = await loadImage(logoUrl);
      const qrCode = await loadImage(qrCodeUrl);

      doc.setFillColor(173, 216, 230); // RGB for light blue
      doc.rect(15, 15, 180, 20, 'F');
      doc.addImage(logo, 'PNG', 20, 15, 25, 25);

      doc.setFont('helvetica', 'bold');
      doc.setTextColor(0, 64, 128);
      doc.setFontSize(18);
      const companyName = 'Ukshati Technologies Pvt Ltd';
      const quoteDate = new Date().toLocaleDateString('en-GB', {
        day: '2-digit',
        month: 'long',
        year: 'numeric',
      });
      const textWidth = doc.getTextWidth(companyName);
      const pageWidth = doc.internal.pageSize.width;
      doc.text(companyName, (pageWidth - textWidth) / 2, 25);

      doc.setFontSize(10);
      doc.setTextColor(0, 0, 0);
      doc.text('2nd Floor, Pramod Automobiles Building,', 15, 45);
      doc.text('Karangalpady, Mangalore - 575003, Karnataka', 15, 50);
      doc.text('Phone: +91 8861567365', 15, 56);
      doc.text('www.ukshati.com', 15, 62);

      doc.setDrawColor(50, 50, 150);
      doc.setLineWidth(0.6);
      doc.line(15, 70, 195, 70);

      doc.setFont('helvetica', 'normal');
      doc.text(
        `Quote ID: ${quote.quote_id}                                      Date: ${quoteDate}`,
        20,
        80
      );
      doc.text(
        `Customer: ${quote.customer_name}                            Address: ${quote.address || 'N/A'}`,
        20,
        90
      );

      doc.text(`Phone: ${quote.phone || 'N/A'}`, 20, 100);

      let yPos = 115;
      doc.setFillColor(200, 200, 200);
      doc.rect(15, yPos - 6, 180, 8, 'F');
      doc.setFont('helvetica', 'bold');
      doc.text('Category', 20, yPos);
      doc.text('Cost (Rs)', 140, yPos);

      const categories = [
        { name: 'Drip', cost: quote.drip_cost },
        { name: 'Plumbing', cost: quote.plumbing_cost },
        { name: 'Automation', cost: quote.automation_cost },
        { name: 'Labour', cost: quote.labour_cost },
      ];

      doc.setFont('helvetica', 'normal');
      yPos += 8;
      categories.forEach(category => {
        const costValue = parseFloat(category.cost) || 0;
        if (costValue > 0) {
          doc.text(category.name, 20, yPos);
          doc.text(`Rs ${costValue.toFixed(2)}`, 140, yPos);
          yPos += 8;
        }
      });
      const additionalCostValue = parseFloat(quote.additional_cost) || 0;
      if (additionalCostValue > 0) {
        doc.text('Additional Cost', 20, yPos);
        doc.text(`Rs ${additionalCostValue.toFixed(2)}`, 140, yPos);
        yPos += 8;
      }

      const totalCostValue = parseFloat(quote.total_cost) || 0;
      doc.setFont('helvetica', 'bold');
      doc.setFillColor(255, 200, 0);
      doc.rect(15, yPos, 180, 8, 'F');
      doc.setTextColor(0, 0, 0);
      doc.text('Total Cost', 20, yPos + 5);
      doc.text(`Rs ${totalCostValue.toFixed(2)}`, 140, yPos + 5);
      yPos += 24;

      doc.setFontSize(11);
      doc.setFont('helvetica', 'bold');
      doc.setTextColor(50, 50, 150);
      doc.text('Bank Details', 20, yPos);
      doc.setFont('helvetica', 'normal');
      doc.setTextColor(0, 0, 0);
      yPos += 8;
      const bankDetails = [
        'Bank Name: XYZ Bank',
        'Account No: 123456789',
        'IFSC Code: XYZ0001234',
        'Branch: Mangalore',
      ];

      bankDetails.forEach(detail => {
        doc.text(detail, 20, yPos);
        yPos += 8;
      });
      // Draw the line after bank details
      doc.setDrawColor(50, 50, 150);
      doc.setLineWidth(0.6);
      doc.line(15, yPos + 5, 195, yPos + 5);

      doc.addImage(qrCode, 'PNG', 145, 180, 30, 30);

      // 5 units below the QR code (which is 40px tall)
      // Green color (RGB: 0,128,0)
      // Thick line
      // Draw line from x=20 to x=190

      // 3. Add Special Notes below the green line (starting a little further down)
      const specialNotesY = yPos + 15; // 10 units below the green line
      doc.setFont('150', 'normal');
      doc.setFontSize(12);
      doc.text('Special Notes:', 20, specialNotesY);
      doc.text('Two-year warranty included.', 20, specialNotesY + 6);
      doc.text('SIM card not included in the package.', 20, specialNotesY + 12);
      doc.text(
        'Payment terms: 70% advance, 30% after installation.',
        20,
        specialNotesY + 18
      );
      doc.text('Extra work charged separately.', 20, specialNotesY + 24);
      doc.text('Wi-Fi extender extra if signal weak.', 20, specialNotesY + 30);
      doc.text(
        'Quote validity: 6 months from date of issue.',
        20,
        specialNotesY + 36
      );

      doc.save(`Quote_${quote.quote_id}.pdf`);
    } catch (error) {
      console.error('Error generating PDF:', error);
    }
  };

  return (
    <div className="min-h-screen text-white bg-black flex flex-col items-center justify-center">
      <div className="absolute top-4 left-4 z-10">
        <BackButton route="/quotation/home" />
      </div>
      <ScrollToTopButton />
      <div className="text-white flex flex-col items-center justify-center w-full px-4 py-20">
        <h1 className="text-4xl font-bold mb-16 mt-8">
          Quote Management System
        </h1>
        <div className="max-w-4xl w-full">
          <div className="p-8 rounded-xl shadow-xl bg-gray-900/80 border border-gray-800 mb-24">
            <h3 className="text-2xl font-semibold mb-4">Search Quotes</h3>

            <div className="mb-4">
              <label className="block font-medium mb-1 text-white">
                Select Search Type:
              </label>
              <select
                value={filterType}
                onChange={e => setFilterType(e.target.value)}
                className="w-full p-2 border rounded bg-gray-700 text-white"
              >
                <option value="quoteId">Quote ID</option>
                <option value="monthRange">Month Range</option>
                <option value="customerName">Customer Name</option>
              </select>
            </div>

            {filterType === 'quoteId' && (
              <input
                type="number"
                value={quoteId}
                onChange={e => setQuoteId(e.target.value)}
                className="w-full p-2 border rounded mb-4 bg-gray-700 text-white"
                placeholder="Enter Quote ID"
              />
            )}

            {filterType === 'monthRange' && (
              <div>
                <div className="mb-4">
                  <label className="block font-medium mb-1 text-white">
                    Select Year:
                  </label>
                  <input
                    type="number"
                    value={year}
                    onChange={e => setYear(e.target.value)}
                    className="w-full p-2 border rounded bg-gray-700 text-white"
                    min="2000"
                    max={new Date().getFullYear()}
                  />
                </div>
                <div className="grid grid-cols-2 gap-4">
                  <div>
                    <label className="block font-medium mb-1 text-white">
                      From Month:
                    </label>
                    <select
                      value={fromMonth}
                      onChange={e => setFromMonth(e.target.value)}
                      className="w-full p-2 border rounded bg-gray-700 text-white"
                    >
                      {months.map(month => (
                        <option key={month.value} value={month.value}>
                          {month.label}
                        </option>
                      ))}
                    </select>
                  </div>
                  <div>
                    <label className="block font-medium mb-1 text-white">
                      To Month:
                    </label>
                    <select
                      value={toMonth}
                      onChange={e => setToMonth(e.target.value)}
                      className="w-full p-2 border rounded bg-gray-700 text-white"
                    >
                      {months.map(month => (
                        <option key={month.value} value={month.value}>
                          {month.label}
                        </option>
                      ))}
                    </select>
                  </div>
                </div>
              </div>
            )}

            {filterType === 'customerName' && (
              <input
                type="text"
                value={customerName}
                onChange={e => setCustomerName(e.target.value)}
                className="w-full p-2 border rounded mb-4 bg-gray-700 text-white"
                placeholder="Enter Customer Name"
              />
            )}

            <motion.button
              onClick={handleSearch}
              className="bg-blue-600 text-white py-2 px-4 mt-4 rounded hover:bg-blue-700 transition flex items-center gap-2"
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
            >
              <FaSearch className="inline-block" />
              Search
            </motion.button>

            {error && <p className="text-red-500 mt-4">{error}</p>}

            {loading ? (
              <div className="mt-6">
                <h3 className="text-xl font-semibold mb-2 text-white">
                  Search Results
                </h3>
                <TableSkeleton rows={3} columns={4} />
              </div>
            ) : (
              quotes.length > 0 && (
                <div className="mt-6">
                  <h3 className="text-xl font-semibold mb-2 text-white">
                    Search Results
                  </h3>
                  {quotes.map(quote => (
                    <div
                      key={quote.quote_id}
                      className="mb-4 p-4 border rounded shadow-md bg-gray-700/90"
                    >
                      <div className="flex justify-between mb-2 text-white">
                        <span>
                          <strong>Quote ID:</strong> {quote.quote_id}
                        </span>
                        <span>
                          <strong>Customer:</strong> {quote.customer_name}
                        </span>
                      </div>
                      <div className="flex justify-between mb-2 text-white">
                        <span>
                          <strong>Project Id:</strong> {quote.project_id}
                        </span>
                        <span>
                          <strong>Project Name:</strong> {quote.pname}
                        </span>
                        <span>
                          <strong>Date:</strong> {quote.date}
                        </span>
                      </div>
                      <div className="flex justify-between mb-4 text-white">
                        <span>
                          <strong>Total Cost:</strong> Rs{' '}
                          {parseFloat(quote.total_cost).toFixed(2)}
                        </span>
                        <motion.button
                          onClick={() => generateQuote(quote)}
                          className="bg-green-600 text-white px-3 py-1 rounded hover:bg-green-700 transition"
                          whileHover={{ scale: 1.05 }}
                          whileTap={{ scale: 0.95 }}
                        >
                          Generate
                        </motion.button>
                      </div>
                    </div>
                  ))}
                </div>
              )
            )}
          </div>
        </div>
      </div>
    </div>
  );
}
